import React from 'react'
import SwapiService from '../../Services/swapi-service'

import './random-planet.css'

const RandomPlanet = () => {

   const swip = new SwapiService();
   swip.getAllPlanets().then((el)=>{
       console.log(el);
   })

   return(
       <div className="header d-flex">
          <img src = "url" alt = 'pict show'/>
       <ul className="d-flex">
           <li>
               <a href = "#">People</a>
           </li>
           <li>
               <a href = "#">Planet</a>
           </li>
           <li>
               <a href = "#">StarShip</a>
           </li>
       </ul>
       </div>
   );
};

export default RandomPlanet;
